import React, { Component }  from 'react';
import { Table } from 'react';
import logo from './logo.svg';
import './App.css';

class Child extends Component {
  render() {
    let {name} = this.props;
    return <li>{name}</li>
  }
}

class Parent extends Component {
  render() {
    return (
        <div>
          <h1>{"Group 1"}</h1>
          <ul>{this.props.hits.map(item => {
                return <Child key={item.id} />
              })}
          </ul>
        </div>
    );
  }
}

class App extends Component {
    constructor(props) {
      super(props);
      this.state = {
        hits: {},
      };
    }
    componentDidMount() {
      fetch('/nba',  {
        headers: {
          "Access-Control-Allow-Origin": "*"
        }
      })
        .then(response => response.json())
        .then(response => {
          console.log(response)
          this.setState({hits: response})
      });
      }


    render() {
      const hits = this.state;
      const display = Object.keys(hits).map((d, key) => {
        console.log(hits[d][0]);
        return (
          <div className="my-posts">
            <li key={key}>
              {hits[d]}
            </li>
          </div>
          );
        });

        return(
          <div>
            <ul>
              { display }
            </ul>
          </div>
        );
    }

  }
export default App;

